import React, { useEffect } from 'react';
import './../styles/header.css';
import { gsap } from 'gsap';
import { ScrollTrigger } from 'gsap/ScrollTrigger';

function Header() {
    gsap.registerPlugin(ScrollTrigger);

    useEffect(() => {
        const main_header = document.querySelector('.main_header');
        const second_header = document.querySelector('.second_header');
        const logo = document.querySelector('.logo');

        // Animation de l'en-tête en réponse au défilement
        gsap.to(main_header, {
            scrollTrigger: {
                trigger: main_header,
                start: 'top top',
                end: 'top top',
                scrub: 1,
                markers: true,
            },
            borderRadius: '20px',
            top: '0px',
            scale: 0.9,
        });

        gsap.to(second_header, {
            scrollTrigger: {
                trigger: second_header,
                start: '58px',
                end: '58px',
                scrub: false,
                markers: true,
                toggleActions: "restart none none none",
                onEnterBack: () => {
                    gsap.to(second_header, {
                        opacity: 1,
                        duration: 1,
                    });
                },
            },
            opacity: 0,
            duration: 1,
        });

        // Animation de rotation du logo au survol
        logo.addEventListener('mouseenter', () => {
            gsap.to(logo, { rotation: 20, duration: 0.5 });
        });

        logo.addEventListener('mouseleave', () => {
            gsap.to(logo, { rotation: 0, duration: 0.5 });
        });
    }, []);

    return (
        <header className="header">
            <div className="second_header">
                <nav className="nav_second_header">
                    <ul className="ul_second_header_media">
                        <li className="li_second_header_media">
                            <a href="https://discord.com/">
                                <img className="logo_discord" src="https://upload.wikimedia.org/wikipedia/fr/thumb/4/4f/Discord_Logo_sans_texte.svg/1818px-Discord_Logo_sans_texte.svg.png" alt="discord" width={30} height={35}/>
                            </a>
                        </li>
                        <li className="li_second_header_media">
                            <a href="https://www.instagram.com/">
                                <img className="logo_instagram" src="https://png.pngtree.com/png-vector/20221018/ourmid/pngtree-instagram-icon-png-image_6315974.png" alt="instagram" width={30} height={30}/>
                            </a>
                        </li>
                        <li className="li_second_header_media">
                            <a href="https://slack.com/">
                                <img className="logo_slack" src="https://assets.stickpng.com/images/5cb480cd5f1b6d3fbadece79.png" alt="slack" width={30} height={30}/>
                            </a>
                        </li>
                        <li className="li_second_header_media">
                            <a href="https://github.com/">
                                <img className="logo_github" src="https://cdn-icons-png.flaticon.com/512/25/25231.png" alt="github" width={30} height={30}/>
                            </a>
                        </li>
                    </ul>
                    <ul className="ul_second_header_contact">
                        <li className="li_second_header_contact">
                                <a className="mail" href="mailto:corentin.albertus@hotmail.fr">corentin.albertus@hotmail.fr</a>
                        </li>
                        <li className="li_second_header_contact">
                                <a className="mail" href="tel:+33782530637">0782530637</a>
                        </li>
                    </ul>
                </nav>
            </div>
            <div className="main_header">
                <nav className="nav_main_header">
                    <img className="logo" src="https://cryptologos.cc/logos/uniswap-uni-logo.png" alt={"logo"}/>
                    <ul className="ul_main_header">
                        <li className="li_main_header"><a href="/">Accueil</a></li>
                        <li className="li_main_header"><a href="/a-propos">À propos</a></li>
                        <li className="li_main_header"><a href="/services">Services</a></li>
                        <li className="li_main_header"><a href="/contact">Contact</a></li>
                    </ul>
                </nav>
            </div>
        </header>
    );
}

export default Header;
